import React, { Component } from 'react'

export default class Home extends Component {
  render() {
    return (
      <div className='container'>
        <h2>My Travels</h2>

        <h4>Planned destinations</h4>

        <h4>Previously visited</h4>
      </div>
    )
  }
}
